import React, { Component } from 'react';

export default class Navbar extends Component {

  render() {
    const logoStyle = {
        width: "80px",
        height: "80px",
      };
    return (
    <nav class="navbar navbar-light navbar-expand-lg fixed-top" id="navbarResponsive">
        <div class="container"><img src={require('../assets/logo192.png')} style={logoStyle}/><button data-toggle="collapse" data-target="#navbarResponsive" class="navbar-toggler" aria-controls="navbarResponsive" aria-expanded="false" aria-label="Toggle navigation"><i class="fa fa-bars"></i></button>
            <div class="collapse navbar-collapse" id="navbarResponsive">
                <ul class="nav navbar-nav ml-auto nav_link">
                    <li class="nav-item" role="presentation"><a class="nav-link active" href="index.php"><font size="5"><strong>近期外务活动</strong></font></a></li>
                    <li class="nav-item" role="presentation"><a class="nav-link" href="about.php"><font size="5">关于我们</font></a></li>
                    <li class="nav-item" role="presentation"><a class="nav-link" href="admin/login.php"><font size="5">管理员登录</font></a></li>
                </ul>
			</div>
        </div>
    </nav>
      
    );
  }
}
